<title>Landing Page</title>

<style>
* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

/* Lock page */
html, body {
  width: 100%;
  height: 100%;
  overflow: hidden;
  touch-action: none;
  font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
  background: #f5f5f5;
}

/* Slide-in animation */
body {
  transform: translateX(100%);
  animation: slideIn 0.5s ease forwards;
}

@keyframes slideIn {
  to { transform: translateX(0); }
}

/* Fullscreen image */
.image-container {
  width: 100vw;
  height: 100vh;
  position: relative;
}

.image-container img {
  width: 100%;
  height: 100%;
  object-fit: cover;
  display: block;
}

/* Invisible button */
.invisible-button {
  position: absolute;
  bottom: 11.3%;
  left: 6%;
  width: 88%;
  height: 12%;
  z-index: 10;
}
</style>

<script>
/* Slide OUT on click */
document.querySelector('.invisible-button').addEventListener('click', e => {
  e.preventDefault();
  const href = e.currentTarget.href;

  document.body.style.transition = 'transform 0.5s ease';
  document.body.style.transform = 'translateX(-100vw)';

  setTimeout(() => {
    window.location.href = href;
  }, 500);
});

/* Kill iOS pinch zoom completely */
['gesturestart','gesturechange','gestureend'].forEach(evt => {
  document.addEventListener(evt, e => e.preventDefault(), { passive: false });
});
</script>
